def pig_latin(word):

    first_letter = word[0]
    if first_letter in 'aeiouAEIOU':
        pig_word = word + 'ay'
    else:
        pig_word = word[1:] + first_letter + 'ay'

    return pig_word

def _getline(cube):

    line = cube.readline().strip().split()
    return int(line[0]), map(float, line[1:])

