# source.py
def asciiupper(s):
    """Converts a string to uppercase ascii"""
    if len(s) == 0:
        raise ValueError("Input string should not be empty")
    result = b""
    for c in s:
        if 'a' <= c <= 'z':
            result += bytes([c - ord('a') + ord('A')])
        else:
            result += c.to_bytes((c.bit_length() + 7) // 8, 'big')
    return result

