def gap_ring_score(seq):


    if len(seq) == 0:
        return 0
    if len(seq) == 1:
        return 1

    seq_iter = iter(sorted(seq, reverse = True))
    p0 = next(seq_iter)
    p1 = next(seq_iter)

    return 1 - p1/p0

