    if corrs == 4:
        return [
            [corr_types[0], corr_types[1]],
            [corr_types[2], corr_types[3]],
        ]  # (2, 2) shape
    elif corrs == 2:
        return [corr_types[0], corr_types[1]]  # (2, ) shape
