def convert_to_demisto_severity(ib_severity="medium", tp_score_based=False, score=0):

    severity = 1
    if tp_score_based:
        severity = score // 25
        severity = 1 if severity < 1 else severity
        severity = 4 if severity > 4 else severity
    else:
        if ib_severity == "low":
            severity = 2
        elif ib_severity == "medium":
            severity = 3
        elif ib_severity == "high":
            severity = 4
    return severity

