import torch

def logsumexp(x, dim=None):

    if dim is None:
        xmax = x.max()
        xmax_ = x.max()
        return xmax_ + torch.log(torch.exp(x - xmax).sum())
    else:
        xmax, _ = x.max(dim, keepdim=True)
        xmax_, _ = x.max(dim)
        return xmax_ + torch.log(torch.exp(x - xmax).sum(dim))

def _uniform_window(dists, width):

    hwidth = width / 2.0
    return (dists <= hwidth).float()

def alert_severity_to_dbot_score(severity_str):

    severity_str = severity_str.lower()
    if severity_str == 'low':
        return 1
    if severity_str == 'medium':
        return 2
    elif severity_str == 'high':
        return 3
    return 0

